import React from "react"
import ReactDOM from "react-dom"

// With pure js
/*
let h1 = document.createElement("div");
h1.innerHTML="<h1>Vanita Chawla</h1>";
document.getElementById("root").appendChild(h1);
*/

// JSX in react js
ReactDOM.render(<h1>Hello World!</h1>,document.getElementById("root"));

// Render Multiple jsx elements using div
ReactDOM.render(
    <div>
<h1>Vanita Chawla</h1>
<h3>Front end developer</h3>
</div>
,document.getElementById("root"));

// Render Multiple jsx elements by returning an array
ReactDOM.render(
   [
<h1>Vanita Chawla</h1>,
<h3>Front-end developer</h3>
]
,document.getElementById("root"));


// Render Multiple jsx elements by using react fragement synthetic sugar form means react fragement shortcut
ReactDOM.render(
    <>
 <h1>Vanita Chawla</h1>
 <h3>Front-end Developer</h3>
 </>
 ,document.getElementById("root"));


// Render Multiple jsx elements by using react fragement 
ReactDOM.render(
    <React.Fragment>
 <h1>Vanita Chawla</h1>
 <h3>Front-end Developer</h3>
 </React.Fragment>
 ,document.getElementById("root"));
